import './MyPosts.css';
import Post from './Post/Post';

function MyPosts() {
	return (
		<div className='postsBlock'>
			My posts
			<div>
				<div>
					<textarea></textarea>
				</div>
				<div></div>
				<button>Add Post</button>
			</div>
			<div className="posts">
				<Post message='Hi, how are you?' likeCount='15' />
				<Post message='It`s my first post!' likeCount='20' />
			</div>
		</div>
	)
};

export default MyPosts;
